import React from "react";
import { Route, BrowserRouter } from "react-router-dom";

const Rotas = () => {
  return (
    <BrowserRouter>
      <Route path="/login" element={<TelaCadastroDeUsuario />}  />

    </BrowserRouter>
  );
};

export default Rotas;
